import PostItem from "./PostItem.js"
import post from "./post.json"

const PostList = () => {
    return (
             <ul class = "list-group">
        {
        post.map(post => {
            return (
                <PostItem post = {post}/>
            );
        })

    }
             </ul>

    );
}

export default PostList;
